(window.webpackJsonp=window.webpackJsonp||[]).push([[100],{392:function(n,s,a){"use strict";a.r(s),s.default='<p><a href="https://npmjs.com/package/expose-loader"><img src="https://img.shields.io/npm/v/expose-loader.svg" alt="npm"></a>\n<a href="https://nodejs.org/"><img src="https://img.shields.io/node/v/expose-loader.svg" alt="node"></a>\n<a href="https://david-dm.org/webpack-contrib/expose-loader"><img src="https://david-dm.org/webpack-contrib/expose-loader.svg" alt="deps"></a>\n<a href="https://github.com/webpack-contrib/expose-loader/actions"><img src="https://github.com/webpack-contrib/expose-loader/workflows/expose-loader/badge.svg" alt="tests"></a>\n<a href="https://codecov.io/gh/webpack-contrib/expose-loader"><img src="https://codecov.io/gh/webpack-contrib/expose-loader/branch/master/graph/badge.svg" alt="coverage"></a>\n<a href="https://gitter.im/webpack/webpack"><img src="https://badges.gitter.im/webpack/webpack.svg" alt="chat"></a>\n<a href="https://packagephobia.now.sh/result?p=expose-loader"><img src="https://packagephobia.now.sh/badge?p=expose-loader" alt="size"></a></p>\n<p>The <code>expose-loader</code> loader allow you to expose module to <code>global</code> object (<code>self</code>, <code>window</code> and <code>global</code>).</p>\n<h2 id="getting-started">Getting Started<a href="#getting-started" aria-hidden="true"><span class="icon icon-link"></span></a></h2>\n<p>To begin, you\'ll need to install <code>expose-loader</code>:</p>\n<pre><code class="hljs language-console">$ npm install expose-loader --save-dev\n</code></pre>\n<p>Then you can use the <code>expose-loader</code> using two approaches.</p>\n<h2 id="inline">Inline<a href="#inline" aria-hidden="true"><span class="icon icon-link"></span></a></h2>\n<p><strong>src/index.js</strong></p>\n<pre><code class="hljs language-js"><span class="token keyword">import</span> $ <span class="token keyword">from</span> <span class="token string">\'expose-loader?exposes[]=$&#x26;exposes[]=jQuery!jquery\'</span><span class="token punctuation">;</span>\n<span class="token comment">//</span>\n<span class="token comment">// Adds the `jquery` to the `global` object under the names `$` and `jQuery`</span></code></pre>\n<pre><code class="hljs language-js"><span class="token keyword">import</span> <span class="token punctuation">{</span> concat <span class="token punctuation">}</span> <span class="token keyword">from</span> <span class="token string">\'expose-loader?exposes=_.concat!lodash/concat\'</span><span class="token punctuation">;</span>\n<span class="token comment">//</span>\n<span class="token comment">// Adds the `lodash/concat` to the `global` object under the name `_.concat`</span></code></pre>\n<pre><code class="hljs language-js"><span class="token keyword">import</span> <span class="token punctuation">{</span>\n  map<span class="token punctuation">,</span>\n  reduce<span class="token punctuation">,</span>\n<span class="token punctuation">}</span> <span class="token keyword">from</span> <span class="token string">\'expose-loader?exposes[]=_.map|map&#x26;exposes[]=_.reduce|reduce!underscore\'</span><span class="token punctuation">;</span>\n<span class="token comment">//</span>\n<span class="token comment">// Adds the `map` and `reduce` method from `underscore` to the `global` object under the name `_.map` and `_.reduce`</span></code></pre>\n<p>The space (<code>%20</code>) or <code>|</code> is the separator between import segments.</p>\n<p>Description of string values can be found in the documentation below.</p>\n<h2 id="using-configuration">Using Configuration<a href="#using-configuration" aria-hidden="true"><span class="icon icon-link"></span></a></h2>\n<p><strong>src/index.js</strong></p>\n<pre><code class="hljs language-js"><span class="token keyword">import</span> $ <span class="token keyword">from</span> <span class="token string">\'jquery\'</span><span class="token punctuation">;</span></code></pre>\n<p><strong>webpack.config.js</strong></p>\n<pre><code class="hljs language-js">module<span class="token punctuation">.</span>exports <span class="token operator">=</span> <span class="token punctuation">{</span>\n  module<span class="token punctuation">:</span> <span class="token punctuation">{</span>\n    rules<span class="token punctuation">:</span> <span class="token punctuation">[</span>\n      <span class="token punctuation">{</span>\n        test<span class="token punctuation">:</span> require<span class="token punctuation">.</span><span class="token function">resolve</span><span class="token punctuation">(</span><span class="token string">\'jquery\'</span><span class="token punctuation">)</span><span class="token punctuation">,</span>\n        loader<span class="token punctuation">:</span> <span class="token string">\'expose-loader\'</span><span class="token punctuation">,</span>\n        options<span class="token punctuation">:</span> <span class="token punctuation">{</span>\n          exposes<span class="token punctuation">:</span> <span class="token punctuation">[</span><span class="token string">\'$\'</span><span class="token punctuation">,</span> <span class="token string">\'jQuery\'</span><span class="token punctuation">]</span><span class="token punctuation">,</span>\n        <span class="token punctuation">}</span><span class="token punctuation">,</span>\n      <span class="token punctuation">}</span><span class="token punctuation">,</span>\n      <span class="token punctuation">{</span>\n        test<span class="token punctuation">:</span> require<span class="token punctuation">.</span><span class="token function">resolve</span><span class="token punctuation">(</span><span class="token string">\'underscore\'</span><span class="token punctuation">)</span><span class="token punctuation">,</span>\n        loader<span class="token punctuation">:</span> <span class="token string">\'expose-loader\'</span><span class="token punctuation">,</span>\n        options<span class="token punctuation">:</span> <span class="token punctuation">{</span>\n          exposes<span class="token punctuation">:</span> <span class="token punctuation">[</span>\n            <span class="token string">\'_.map|map\'</span><span class="token punctuation">,</span>\n            <span class="token punctuation">{</span>\n              globalName<span class="token punctuation">:</span> <span class="token string">\'_.reduce\'</span><span class="token punctuation">,</span>\n              localName<span class="token punctuation">:</span> <span class="token string">\'reduce\'</span><span class="token punctuation">,</span>\n            <span class="token punctuation">}</span><span class="token punctuation">,</span>\n            <span class="token punctuation">{</span>\n              globalName<span class="token punctuation">:</span> <span class="token punctuation">[</span><span class="token string">\'_\'</span><span class="token punctuation">,</span> <span class="token string">\'filter\'</span><span class="token punctuation">]</span><span class="token punctuation">,</span>\n              localName<span class="token punctuation">:</span> <span class="token string">\'filter\'</span><span class="token punctuation">,</span>\n            <span class="token punctuation">}</span><span class="token punctuation">,</span>\n          <span class="token punctuation">]</span><span class="token punctuation">,</span>\n        <span class="token punctuation">}</span><span class="token punctuation">,</span>\n      <span class="token punctuation">}</span><span class="token punctuation">,</span>\n    <span class="token punctuation">]</span><span class="token punctuation">,</span>\n  <span class="token punctuation">}</span><span class="token punctuation">,</span>\n<span class="token punctuation">}</span><span class="token punctuation">;</span></code></pre>\n<p>The <a href="https://nodejs.org/api/modules.html#modules_require_resolve_request_options"><code>require.resolve</code></a> call is a Node.js function (unrelated to <code>require.resolve</code> in webpack processing).\n<code>require.resolve</code> gives you the absolute path to the module (<code>"/.../app/node_modules/jquery/dist/jquery.js"</code>).\nSo the expose only applies to the <code>jquery</code> module. And it\'s only exposed when used in the bundle.</p>\n<p>And run <code>webpack</code> via your preferred method.</p>\n<h2 id="options">Options<a href="#options" aria-hidden="true"><span class="icon icon-link"></span></a></h2>\n<h3 id="exposes">exposes<a href="#exposes" aria-hidden="true"><span class="icon icon-link"></span></a></h3>\n<p>Type: <code>String|Object|Array</code>\nDefault: <code>undefined</code></p>\n<p>List of exposes.</p>\n<h4 id="string"><code>String</code><a href="#string" aria-hidden="true"><span class="icon icon-link"></span></a></h4>\n<p>Allows to use a string to describe an expose.</p>\n<p>The space (<code>%20</code>) or <code>|</code> is the separator between import segments.</p>\n<p>String syntax - <code>[[globalName] [localName]]</code>, where:</p>\n<h5 id="globalname">globalName<a href="#globalname" aria-hidden="true"><span class="icon icon-link"></span></a></h5>\n<p>Type: <code>String|Array</code>\nDefault: <code>undefined</code></p>\n<p>Name of an exposed value in <code>global</code> object (<strong>required</strong>)</p>\n<p>Possible syntax:</p>\n<ul>\n<li><code>root</code></li>\n<li><code>root.nested</code></li>\n<li><code>["root", "nested"]</code> - may be useful if the dot is part of the name</li>\n<li><code>[[name]]</code> - expose module in <code>global</code> object under the name equal to the filename, for <code>single.js</code> it will be <code>global.single</code>.</li>\n<li><code>[myGlobal.[name]]</code> - expose module in <code>global.myGlobal</code> under the name equal to the filename, for <code>single.js</code> it will be <code>global.myGlobal.single</code>.</li>\n</ul>\n<h5 id="localname">localName<a href="#localname" aria-hidden="true"><span class="icon icon-link"></span></a></h5>\n<p>Type: <code>String</code>\nDefault: <code>undefined</code></p>\n<p>Name of an exposed value</p>\n<h2 id="contributing">Contributing<a href="#contributing" aria-hidden="true"><span class="icon icon-link"></span></a></h2>\n<p>Please take a moment to read our contributing guidelines if you haven\'t yet done so.</p>\n<h2 id="contributing-1">Contributing<a href="#contributing-1" aria-hidden="true"><span class="icon icon-link"></span></a></h2>\n<p>Please take a moment to read our contributing guidelines if you haven\'t yet done so.</p>\n<p><a href="https://github.com/webpack-contrib/expose-loader/blob/master/.github/CONTRIBUTING.md">CONTRIBUTING</a></p>\n<h2 id="license">License<a href="#license" aria-hidden="true"><span class="icon icon-link"></span></a></h2>\n<p><a href="https://github.com/webpack-contrib/expose-loader/blob/master/LICENSE">MIT</a></p>\n'}}]);